import React from 'react';

 import { Background, CardOverlay, Container, Item , Image} from './styles';

const ListingItem: React.FC = () => {
  return (
      <Container>
          <Item>
            <Background>
                <Image src="https://res.cloudinary.com/glovoapp/w_700,h_360,c_fill,f_auto,q_auto/Stores/u6jn2a5cvugwnjl4xusn" ></Image>
                <CardOverlay></CardOverlay>
            </Background>
            </Item>
      </Container>

  );
}

export default ListingItem;
